    if (!cpf) {
        return "";
    }

    // Remover qualquer caractere que não seja número (apenas por segurança)
    const cleanCpf = cpf.replace(/\D/g, '');

    // Se tiver exatamente 11 dígitos, é um CPF válido
    if (cleanCpf.length === 11) {
        return cleanCpf;
    }

    // Se tiver exatamente 14 dígitos, pode ser considerado um CNPJ válido
    if (cleanCpf.length === 14) {
        return cleanCpf;
    }

    // Caso não seja nem CPF nem CNPJ válido, retornar vazio
    return "";
})()
